import "./Expenses.css"

function Expenses(props) {
    const day = props.date.toLocalString("en-US")

    return (
        <div className="expense-item">
            <div>
                {props.date.toString()}
            </div>
            <div className="expense-item__description">
                <h2>{props.title}</h2>
            <div className="expense-item__price">
                <h2>${props.amount}</h2>
            </div>
            </div>
        </div>
    )
}

export default Expenses;
